[application]

name="Zed and Ginger"
main_scene="res://root.xscn"
disable_stdout=false
icon="res://sprites/window_icon.png"
target_fps=60
boot_logo=img(rgb, 0, 180, 180, )
boot_bg_color=#ff000000

[autoload]

logger="res://root/logger.gd"
utilities="res://root/utilities.gd"
mesh_manager="res://root/mesh_manager.gd"
object_data="res://root/object_data.gd"

[debug]

verbose_stdout=false
print_fps=false

[display]

emulate_touchscreen=false
tooltip_delay=0.7
orientation="landscape"
resizable=false
stretch_mode="2d"

[image_loader]

filter=false
gen_mipmaps=false
repeat=false

[input]

jump=[key(Space)]
move_up=[key(Up), key(W)]
move_down=[key(Down), key(S)]
move_right=[key(D), key(Right)]
move_left=[key(A), key(Left)]

[locale]

translations=["res://translations/trans.en.xl"]

[physics]

fixed_fps=40
enable_object_picking=true

[render]

shadows_enabled=true
mipmap_policy=2
default_clear_color=#ff404040
thread_model=1
